import numpy as np

from CodeTimer import Timer

class Solution:
    
    totalTimer = Timer()

    def maximalRectangle(self, matrix: list[list[str]]) -> int:
        
        curr_row = np.zeros(len(matrix[0]))
        max_area = 0
        
        for row in matrix:
            
            curr_row = (curr_row+1) * np.asarray(row, dtype=int)
            unique_vals = np.unique(curr_row[curr_row != 0])
            tracker = np.zeros_like(unique_vals)

            if unique_vals.size > 0:
                for val in curr_row:
                    if val == 0:
                        max_area = max(max_area, max(tracker * unique_vals))
                        tracker = np.zeros_like(unique_vals)
                    else:
                        summation = val >= unique_vals
                        if all(summation) != True:
                            max_area = max(max_area, max(tracker[~summation] * unique_vals[~summation]))
                        tracker = np.where(summation, tracker + 1, 0)

                max_area = max(max_area, max(tracker * unique_vals))
        return int(max_area)
